import React, { Component } from 'react';
import { connect } from "react-redux";
import { getRankings } from '../../actions/actionsAPI';

const mapDispatchToProps = dispatch => {
    return {
        getRankings: team => dispatch(getRankings(team))
    }
}

const mapStateToProps = state => {
    console.log(state)
    return {
        rankings: state.rankingsReducer.rankings
    }
}

class Rankings extends Component {
    constructor(props) {
        super(props)

        this.state = {
            week: '',
            year: ''
        }

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleYearChange(event) {
        // console.log(event.target.value)
        this.setState({year: event.target.value});
        console.log(this.state.year)
      }

    handleSubmit(event) {
        event.preventDefault()
        this.props.getRankings(this.state.year)
    }

    render() {
        return(
            <div>
                <div>Rankings</div>
                <form className="text-black" onSubmit={this.handleSubmit}>
                    <label>
                    Year:
                    <select value={this.state.year} onChange={this.handleYearChange}>
                        <option value="2019">2019</option>
                        <option value="2018">2018</option>
                        <option value="2017">2017</option>
                    </select>
                    </label>

                    <label>
                        Week:
                        <select>
                            <option>1</option>
                            <option>2</option>
                            <option>3</option>
                            <option>4</option>
                            <option>5</option>
                            <option>6</option>
                            <option>7</option>
                            <option>8</option>
                            <option>9</option>
                            <option>10</option>
                            <option>11</option>
                            <option>12</option>
                            <option>13</option>
                            <option>14</option>
                            <option>15</option>
                        </select>
                    </label>
                    <input type="submit" value="Submit" />
                </form>
            </div>
        )
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Rankings)
